script: |
  super -f text -I q343.spq | sort > q343.out

inputs:
  - name: q343.spq
    data: |
      SELECT DISTINCT col2 * + col1 + - ( + 20 ) + col1 / - ( 78 * - cor0.col2 ) AS col1 FROM tab1 (FORMAT parquet) cor0;
  - name: tab1

outputs:
  - name: q343.out
    data: |
      1228
      1384
      550
